DAY 23*: OLAHRAGA
Ku bukanlah sebuah kata yang bersinonim dengan olahraga; lebih baik tidur daripada memasokan diri berlari di lapangan. Ketika pembukaan pendaftaran ukm di kampusku pun, aku tak memilih satupun ukm olahraga fisik. (kalau olahraga nonfisik ada si) Lalu, semua (mungkin berubah) saat ku menjalani semester ini, diintai kembali oleh pelajaran berkode KU, berisi olahraga. Ia memintaku untuk berlari 2.4 km, dan berlatih puluhan kali selama semester ini. Padahal di semester ini aku diserang pula dari berbagai penjuru, baik akademis maupun non akademis. Jadi bagaimana cerita lanjutan aku dan olahraga? Ah udah ya, aku capek. 
