DAY 18: JALAN-JALAN
Dua minggu lebih sedikit di rumah dalam merayakan libur tengah semester kuhabiskan untuk berjalan-jalan ke sudut-sudut provinsi, menyisakan keinginan untuk jalan-jalan lagi. Apa daya, sekarang semester dua telah menyambutku dengan pelajaran dan kegiatan baru. Rasanya ingin ku berlari, menjelajahi kota pelajar ini. Tapi apa daya, selain disapa mesra oleh rentetan tugas, ku juga dikawal oleh keuanganku. Ah, berjalan di sekitar tempat tinggalku mungkin cukup untuk sementara ini. Teehee. 
@30haribercerita #30haribercerita #30hbc1718

DAY 17: OBRAL BUKU
Sebenarnya gw gak berniat datang ke obral ini. Berawal dari kebosanan karena hari ini nirkelas, gw memutuskan untuk mengambil angkot ke @gramedia untuk mencari manga Tanaka-kun. Namun kemudian, gw melihat poster "Gramedia Big Sale", yang menyeret w ke jurang kekhilafan. Yasudahlah, lumayan. Keliling cuci mata, melihat buku dari berbagai era yang dijual 5k atau 10k. Kalau cukup hoki dan telaten mengais ribuan buku di sana, mungkin w bisa mendapatkan buku-buku terkenal dengan harga miring, tetapi sayang dihalangi oleh dompet. Ah, what a day. Mumpung masih ada sampai 30 Januari, kuy dateng. *kalo mau bayarin gw sih, kuy juga. 
@30haribercerita #30haribercerita #30hbc1717

DAY 13: NAIK BUKIT
Akhir minggu kemaren, gw bersama keluarga memutuskan untuk pergi ke gua berangin di Batu Laki. Kebetulan letaknya dekat dengan kampung halaman bokap gw. Dekat di sini ngga berarti sepelemparan batu, melainkan naik mobil belasan menit, lalu jalan ratusan meter, lalu melewati jalanan curam ratusan meter, dengan kiri kanan hehutanan. Dan gw cuma pake sendal jepit, damn. Tapi selepas naik, lumayan uga viewnya, dapat ngeliat kampung sebelah. Etapi di kampung sebelah lagi nikahan (gw mendaki hari minggu), dan suara nyanyian lagunya terdengar sampai ke atas bukit. Heuh. Dan juga, di belakang view ini, ada gua yang mengeluarkan angin laksana ac, sepoi sepoi kencang sejuk. Ah, perjuangan kami terbayar lunas. (etapi adek gw sakit setelahnya, hhhheuu) 
